import React from "react";
import Carousel from "../components/Carousel";
import Contact from "./Contact";
import About from "./About";

export default function Home() {
  return (
    <>
      <Carousel />
      <hr />
      <About />
      <hr />
      <Contact />
    </>
  );
}
